import mediaquery from './mediaquery'
export default {
    root: {
        alignItems: "center",
        display: "flex",
        fontWeight: 'bold',
        justifyContent: "flex-end",
        
        height: "4vh",
        [mediaquery.down('xs')]: {
            display: 'none',
          },
        

    },
    emoji: {
        fontSize: "1.3rem",
        margin: "0 1rem",
    }
}
